import logo from './logo.svg';
import './App.css';

function App() {    // functional component
  return (
    // React js does not allow parallel components, So we have to put it all under a div
    <div>
      <Header/>
      <h1>Startup app</h1>
      <p>My first app</p>   
      </div>

  );
}

export default App;




